struct audio_t {
    volatile unsigned int control;  // The control/status register
    volatile unsigned char rarc;	// the 8 bit RARC register
    volatile unsigned char ralc;	// the 8 bit RALC register
    volatile unsigned char warc;	// the 8 bit warc register
    volatile unsigned char walc;	// the 8 bit walc register
    volatile unsigned int ldata;	// the 32 bit (really 24) left data register
    volatile unsigned int rdata;	// the 32 bit (really 24) right data register
};


typedef struct {
    int row;
    int col;
} Coordinates;

typedef struct {
    short int shape[4][4]; // shape of the block
    Coordinates start;   // Starting position of the block
    Coordinates offset;  // Current position offset from start
    short int rotation[4][4][4]; // each has its own rotation configuration
    short int color;     // color of the block
    int rotation_state; // current rotation state of the block
} TetrisBlock;

