int main_game() {
    initialize_board();
    clear_screen_init();

    game_state = true;
    TetrisBlock prev_block;
    // Merge the block onto the game board

    // until board is full
    clear_background();
    for (int i = 100000; i != 0; i--){}
    while (game_state) {
        clear_FIFO(0);
        TetrisBlock block = generate_random_block();
        moving = true;
        // Keep moving the block down until it reaches the bottom or collides with other blocks
        while (moving) {
            prev_block = block;
			// get user input
            user_handler(&block, &prev_block);
           	for (int i = 10000; i != 0; i--){}
        }
        merge_block(&prev_block);
        draw_board();

        if (is_game_over()) {
			game_over();
            game_state = false;
			clear_FIFO(0);
            //printf("Game is over\n");
            scoreGlob = 0;
            check_key_press();
        }
        //TODO: change location
        if(check_hor()) //checks whether a row was completed and shifts all blocks down
            draw_board();
    }
    return 0;
}

// Decides the movement of the block
void user_handler(TetrisBlock *block, TetrisBlock *prev_block){
	int byte3 = 0;
	int PS2_data, RVALID; 
    PS2_data = *(PS2_ptr);	// read the Data register in the PS/2 port
    RVALID = (PS2_data & 0x8000);	// extract the RVALID field
    if (RVALID != 0) {
        /* always save the last three bytes received */
        byte3 = (int) (PS2_data & 0xFF);	
    }
    // If the input is 'enter', 'down', 'space' or 's' keys, then move the block down if possible
    if ((byte3 == ENTER) || (byte3 == DOWN) || byte3 == SPACE || byte3 == SKEY){
        if (move_block_down(block, prev_block)) {
            make_move(block);
            clear_FIFO(0);
        } else {
            moving = false;
        }
    // else if input is 'z' key then rotate it counter-clockwise 
    } else if (byte3 == ZKEY){ //Rotate piece counter-clockwise
        rotate_ccw = true;
        if (rotate_ccw && rotate_counter_clockwise(block, prev_block)){
            make_move(block);
            clear_FIFO(0);
        }
        rotate_ccw = false;
    // else if input is 'x' key then rotate it clockwise
    } else if (byte3 == XKEY){ //Rotate piece clockwise
		rotate_cw = true;
        if (rotate_cw && rotate_clockwise(block, prev_block)){
            make_move(block);
            clear_FIFO(0);
        }
        rotate_cw = false;
    // if 'right arrow' key, the move block 1 unit right
	} else if (byte3 == RIGHT){
		right = true;
        if (right && move_block_right(block, prev_block)) {
            make_move(block);
            clear_FIFO(0);
        }
		right = false;
    // if 'left arrow' key, then move block 1 unit left
    }else if (byte3 == LEFT){
       	left = true;
        if (left && move_block_left(block, prev_block)) {
            make_move(block);
            clear_FIFO(0);
        }
		left = false;
    } else if (byte3 == ESC || byte3 == QKEY) //quit game
    {
        game_over();
        game_state = false;
        clear_FIFO(0);
        scoreGlob = 0;
        check_key_press();
    }
    else {
        left = false;
		right = false;
		rotate_cw = false;
		rotate_ccw = false;
        moving = true;
        // keep moving the block down each time regardless
        if (move_block_down(block, prev_block)){
            make_move(block);
        } else {
            moving = false;
        }
    }
    // clear the fifo when there are more than 1 elements in the fifo memory
    if(read_available(*(PS2_ptr)) > 1) // Make sure fifo doesn't over flow
        clear_FIFO(1);
    
}

// Draws the pixel given an x and y coordinate and a colour
void plot_pixel(int x, int y, short int line_colour){
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_colour;
}
// Draw the tetris background
void draw_background(const uint16_t background[240][320]){
    for (int y = 0; y < SCREEN_Y; y++){
        for (int x = 0; x < SCREEN_X; x++){
            plot_pixel(x, y, background[y][x]);
        }
    }
}
// Function waits for the S bit to become 0 again - means synchronization is complete
void wait_for_vsync(){
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020; // pixel (DMA) controller (I/O)
    int status;
    *pixel_ctrl_ptr = 1; // start synchronization; s bit is set to 1
    status = *(pixel_ctrl_ptr + 3); // read status register at address
    while ((status & 0x01) != 0){
        status = *(pixel_ctrl_ptr+3);
    }
}

// clears the whole screen given the the screen coordinates and drawing blank pixels
void clear_screen_init(){
    for(int temp_x = 0; temp_x < SCREEN_X; temp_x++){
        for(int temp_y = 0; temp_y < SCREEN_Y; temp_y++){
            plot_pixel(temp_x, temp_y, BLANK);  //draw  0x0000 everywhere
        }
    }
}

// Function swaps two values with each other using pointers
void swap(int *a, int *b){
    int temp = *a;
    *a = *b;
    *b = temp;
}

