bool check_hor() //TODO: Get fully working - block keeps going down until a collison - once a row is cleared, check again starting from the bottom 
{
    int numClearedRow = 0;
    bool cleared = false;

    for (int i = ROWS-1; i >= 0; i--) { //start at the bottom

        for (int j = 0; j < COLS; j++) 
        {
            if((int) board[i][j] == -1) //at least one piece in the row is blank 
                break;
            
            if(j == COLS-1){ // if you reach the last piece in the row
                //clear row
                for(int a = 0; a < COLS; a++){
                    board[i][a] = -1; // clear
                }
                numClearedRow++; 
                i += 1;
            }
        }

        //move row numClearedRows down 
        if(numClearedRow > 0 && i-1-numClearedRow >= 0){
            for(int a = 0; a < COLS; a++){
                board[i-1][a] = board[i-1-numClearedRow][a]; // shift row down
                board[i-1-numClearedRow][a] = -1; //clear old row                    
            }
        }

    }
    cleared = numClearedRow > 0;
    if(cleared){
        scoreGlob += numClearedRow; //Reward user more if they clear more rows in one move //culsTODO: differewnt score calculation?
    }
    return cleared;
}

