// Function returns the available data to be read from the fifo
alt_u16 read_available(alt_u32 data_reg){
  alt_u16 ravail = (alt_u16)((data_reg & RAVAIL_MSK ) >> RAVAIL_OFST);
  return ravail;
}

// Clears the all data from the fifo
void clear_FIFO(int data_num){
  // The DATA byte of the data register will be automatically cleared after
  // a read, so we simply keep reading it until there are no available bytes
  volatile int * PS2_ptr = (int *) 0xFF200100;	
  alt_u16 num = 0;
  alt_u32 PS2_data = 0;
  do {
    // read the data register (the DATA byte is cleared)
    PS2_data = *(PS2_ptr);
    // get the number of available bytes from the RAVAIL part of data register
    num = read_available(PS2_data);
  } while (num > data_num);
}

