// Checks if 'enter' is pressed
void check_key_press(){
    bool pressed = false;
    int byte3 = 0;
    int PS2_data, RVALID; 
    while(pressed == false){
        PS2_data = *(PS2_ptr);	// read the Data register in the PS/2 port
        RVALID = (PS2_data & 0x8000);	// extract the RVALID field
        if (RVALID != 0) {
            /* always save the last three bytes received */
            byte3 = (int) (PS2_data & 0xFF);	
        }

        if (byte3 == ENTER){
            pressed = true;
            clear_FIFO(0);
            if(!showedInstructions)
            {
                show_instructions();
                showedInstructions = true;

                check_key_press();
            } else
                main_game();

        } else {
            // keep reading
        }
    }
    clear_FIFO(0);
}

